7	2	en	Malak Ben Giaber is systemic practitioner and trainer working with the Solution Focused Approach. She has an MSc in Clinical Psychology and a BA in Psychology. She has worked with communities across the South West Asia and North Africa region with humanitarian NGO’s consulting on issues pertaining to Mental Health (MH) and Psychosocial Support (MHPSS).  She is a Director of Ejaz for Consultancy and Training, a centre in Tripoli, Libya where she works with individuals, families, professionals and groups to find ways forward in challenging contexts. She was previously and is currently assigned president of a consultative committee ensuring that work relevant to MH in Libya meets international guidelines and standards of best practice, ethical care and competency.  Malak is also a qualitative researcher in the nature of civil participation and processes involved with change on the individual and community level.  She is currently involved with drafting a MH policy for a Libyan civil society organization.	
8	2	ar	ملاك بن جابر هي ممارس ومدربة منهجية تعمل وفقًا لنهج التركيز على الحل. حصلت على ماجستير في علم النفس السريري وبكالوريوس في علم النفس. عملت مع مجتمعات في جميع أنحاء منطقة جنوب غرب آسيا وشمال إفريقيا مع المنظمات غير الحكومية الإنسانية في الاستشارات بشأن القضايا المتعلقة بالصحة العقلية والدعم النفسي الاجتماعي. وهي مديرة مركز إعجاز للاستشارات والتدريب، وهو مركز في طرابلس، ليبيا حيث تعمل مع الأفراد والأسر والمهنيين والمجموعات لإيجاد طرق للمضي قدمًا في السياقات الصعبة. كانت سابقًا ولا تزال رئيسة للجنة استشارية تضمن أن العمل المتعلق بالصحة العقلية في ليبيا يفي بالمبادئ التوجيهية والمعايير الدولية لأفضل الممارسات والرعاية الأخلاقية والكفاءة. ملاك هي أيضًا باحثة نوعية في طبيعة المشاركة المدنية والعمليات المرتبطة بالتغيير على مستوى الفرد والمجتمع. وهي تشارك حاليًا في صياغة سياسة الصحة العقلية لمنظمة مجتمع مدني ليبية.	ملاك بن جابر
11	6	en	Reem Ben Giaber is a PhD candidate at IOE’s Department of Learning and Leadership at UCL’s Faculty of Education and Society in the UK. She has an MA in Education Studies from Concordia University. Reem is an Associate Fellow at the Higher Education Academy and a co-founder of a research and practice network: SWANA Forum for Social Justice. Reem has worked in the education sector for 20 years in Libya, Canada and the UK. She was Guest Lecturer at the IOE and is an experienced Seminar Leader in the IOE’s Education, Practice and Society Department. Reem’s research interests include John Dewey’s pragmatist philosophy of education, teacher agency, teacher education and professional development, civil society and civil society organisation and the role teachers may play in the link between school and society in Libya.\n	
12	6	ar	ريم بن جابر هي طالبة دكتوراه في قسم التعلم والقيادة في معهد التعليم بكلية التربية والمجتمع في جامعة لندن بالمملكة المتحدة. حصلت على درجة الماجستير في دراسات التربية من جامعة كونكورديا. ريم زميلة مشاركة في أكاديمية التعليم العالي ومؤسس مشارك لشبكة بحثية وممارسية: منتدى جنوب غرب آسيا وشمال أفريقيا للعدالة الاجتماعية. عملت ريم في قطاع التعليم لمدة 20 عامًا في ليبيا وكندا والمملكة المتحدة. كانت محاضرة زائرة في معهد التعليم وهي قائدة ندوات متمرسة في قسم التعليم والممارسة والمجتمع في معهد التعليم. تشمل اهتمامات ريم البحثية فلسفة جون ديوي البراجماتية للتعليم، ووكالة المعلمين، وتعليم المعلمين والتطوير المهني، والمجتمع المدني ومنظمات المجتمع المدني والدور الذي قد يلعبه المعلمون في الرابط بين المدرسة والمجتمع في ليبيا.	ريم بن جابر
13	5	en	Munira Bengashier has a PhD in Micro Nano Electronics and an MPhil in Micro-nano Electronics from the University of Malta, an MSc in Electronic Engineering and a BSc in Computer Engineering from University of Tripoli-Libya. Her research interests and skills include RF-MEMS Resonators and Switches, Design- Simulation and Characterization. Munira is a Certified Instructor in ICS/ICDL since 2008. 	
14	5	ar	حصلت منيرة بنجشير على درجة الدكتوراه في إلكترونيات النانو الدقيقة ودرجة الماجستير في إلكترونيات النانو الدقيقة من جامعة مالطا، وماجستير في الهندسة الإلكترونية وبكالوريوس في هندسة الكمبيوتر من جامعة طرابلس-ليبيا. تشمل اهتماماتها البحثية ومهاراتها في مجال الرنانات والمفاتيح RF-MEMS والتصميم والمحاكاة والتمييز. منيرة مدربة معتمدة في ICS/ICDL منذ عام 2008.	منيرة بن غشــير
